func TestGenerateBlobTx(t *testing.T) {
	privateKey, err := crypto.GenerateKey()
	if err != nil {
		fmt.Printf("Failed to generate private key: %v\n", err)
		return
	}
	// Print the private key (for demonstration; in production, secure this!)
	privateKeyBytes := crypto.FromECDSA(privateKey)
	fmt.Printf("Generated Private Key: %x\n", privateKeyBytes)

	// Get the public key and sender address
	publicKey := privateKey.Public()
	publicKeyECDSA, ok := publicKey.(*ecdsa.PublicKey)
	if !ok {
		fmt.Println("Failed to cast public key to ECDSA")
		return
	}
	fromAddress := crypto.PubkeyToAddress(*publicKeyECDSA)
	fmt.Printf("Sender Address: %s\n", fromAddress.Hex())

	// Get the chain ID
	chainID := big.NewInt(6969)

	// Get the nonce
	nonce := 44444

	// Define example blob data (must be 32-byte aligned, max 128KB per blob)
	blobData := [][32]byte{
		common.HexToHash("0x1234567890abcdef1234567890abcdef1234567890abcdef1234567890abcdef"),
	}

	// Create KZG commitments and proofs (simplified; requires KZG setup in production)
	// Note: This is a placeholder. Real KZG setup requires trusted setup and go-ethereum's blobpool.
	blobHashes := []common.Hash{
		crypto.Keccak256Hash(blobData[0][:]),
	}
	// Create the BlobTx
	gasLimit := uint64(21000)                       // Adjust based on your needs
	gasTipCap := big.NewInt(2000000000)             // 2 Gwei, priority fee
	gasFeeCap := big.NewInt(20000000000)            // 20 Gwei, max fee
	value := big.NewInt(1000000000000000000)        // 1 ETH in wei
	to := common.HexToAddress("0xRecipientAddress") // Replace with actual recipient

	tx := types.NewTx(&types.BlobTx{
		ChainID:    uint256.MustFromBig(chainID),
		Nonce:      uint64(nonce),
		GasTipCap:  uint256.MustFromBig(gasTipCap),
		GasFeeCap:  uint256.MustFromBig(gasFeeCap),
		Gas:        gasLimit,
		To:         to,
		Value:      uint256.MustFromBig(value),
		Data:       nil,                // No data for a simple transfer
		AccessList: types.AccessList{}, // Optional access list
		BlobFeeCap: uint256.MustFromBig(gasFeeCap),
		BlobHashes: blobHashes,
		Sidecar: &types.BlobTxSidecar{
			Blobs:       []kzg4844.Blob{{0x0a, 0x0b, 0x0c}, {0x0d, 0x0e, 0x00}},
			Commitments: []kzg4844.Commitment{{0x01}, {0x02}, {0x03}}, // Placeholder; requires KZG commitments
			Proofs: []kzg4844.Proof{
				{0x01, 0x02},
				{0x03, 0x04},
				{0x05, 0x06},
			}, // Placeholder; requires KZG proofs
		},
	})
	// Sign the transaction
	signer := types.LatestSignerForChainID(chainID)
	signedTx, err := types.SignTx(tx, signer, privateKey)
	if err != nil {
		fmt.Printf("Failed to sign transaction: %v\n", err)
		return
	}

	b, err := rlp.EncodeToBytes(signedTx)
	if err != nil {
		fmt.Printf("Failed to encode transaction: %v\n", err)
		return
	}
	fmt.Printf("Signed acceslist Transaction: %x\n", b)
}
