		assert.Equal(t, tx.GasTipCap(), customTx.GasTipCap)
		assert.Equal(t, tx.GasFeeCap(), customTx.GasFeeCap)
		assert.Equal(t, tx.Gas(), customTx.Gas)
		assert.Equal(t, tx.To(), customTx.To)
		assert.Equal(t, tx.Value(), customTx.Value)
		assert.Equal(t, tx.Data(), customTx.Data)
		assert.Equal(t, tx.AccessList(), customTx.AccessList)
		v, r, s := tx.RawSignatureValues()
		assert.Equal(t, v, customTx.V)
		assert.Equal(t, r, customTx.R)
		assert.Equal(t, s, customTx.S)
		assert.Equal(t, tx.Hash(), customTx.Hash())
